// src/pages/Proyectos.js
import React from 'react';

export default function Proyectos() {
  return (
    <section style={{ padding: '2rem' }}>
      <h2>Proyectos Destacados</h2>
      <ul>
        <li>Script AutoHotkey – Generador de llamadas CNC</li>
        <li>Grasshopper – Exportador de diámetros a CSV</li>
        <li>Portfolio IT – Sitio estático con React</li>
        {/* etc. */}
      </ul>
    </section>
  );
}
